window.bookSummaryJSON = "<p><b>Love is never painless. </b></p> <p><b>Especially when you love dangerous men. </b> </p> <p>My heart wants the most dangerous one of all - the golden man with the beautiful smile. Gunner strikes enemies as ruthlessly as his falcon, but when it comes to <i>us</i>, he keeps me tortured and begging for a swift end. </p> <p>He crushed me once, then kissed hope back into me. His indecision will be the slow, painful death of me. I’m done waiting. I’ll make him put me out of my misery or pull the trigger myself. </p> <p>If dealing with him wasn’t enough pain, I’m also getting my Steel Demons tattoo from Shadow. </p> <p>The scarred, quiet man has been coming around to me slowly. My new cat companion is obsessed with him. If my time with the Steel Demons has taught me anything, it’s to trust the instincts of our animal guardians. </p> <p>They’re intelligent. Sometimes, they even talk to us. </p> <p>I don’t expect my first tattoo to be painless. But can I heal my artist from the pain he keeps locked inside? </p> <p><i>Sons of Anarchy</i> meets <i>The Handmaid's Tale</i> in this dystopian reverse-harem adventure! Painless is the fourth book in the Steel Demons MC saga. This series is full of steam and dangerous men who take what they want. Proceed with caution if easily offended. </p> <p>Listening order: </p> <ol> <li><i>Lawless </i></li> <li><i>Powerless </i></li> <li><i>Fearless </i></li> <li><i>Painless</i></li> </ol>"; 
